webpackJsonp([17886128359534],{1160:function(t,a){t.exports={data:{site:{siteMetadata:{title:"Justin Ball",author:"Justin Ball"}},markdownRemark:{id:"/Users/jbasdf/projects/justinball/src/posts/2015-06-17-course-setup-using-google-docs-and-the-canvas-api/index.md absPath of file >>> MarkdownRemark",html:'<p>From my presentation at <a href="http://www.canvaslms.com/news/instructurecon/">InstructureCon 2015</a>:</p>\n<h4>About us</h4>\n<p>We\'re <a href="http://www.atomicjolt.com/c/canvas-landing.html">Atomic Jolt</a>. We build cool stuff. We built some of the very first Canvas integrations using LTI and the Canvas API. We\'ve been doing this as long as Canvas has been around. Anything you want Canvas to do that it doesn\'t already do we\'ll make it do it.</p>\n<p><a href="http://demoarigato.herokuapp.com/">Demo Arigato</a> simplifies the repetitive task of setting up the same courses, users, discussions etc. We created it for the sales team at <a href="http://www.instructure.com/">Instructure</a>, but you can use it in your Canvas instance as well.</p>\n<h4>Helpful resources:</h4>\n<ul>\n <li><a href="http://demoarigato.herokuapp.com/">Demo Arigato</a></li>\n <li><a href="https://github.com/atomicjolt/demo_arigato">Demo Arigato Source Code</a></li>\n <li><a href="https://rubygems.org/gems/omniauth-canvas/versions/0.1.0">Canvas OmniAuth gem</a></li>\n <li><a href="https://github.com/atomicjolt/omniauth-canvas">Canvas OmniAuth gem source code</a></li>\n <li><a href="https://github.com/atomicjolt/canvas_starter_app">Canvas Starter App - for when you want to get going on your own project</a></li>\n</ul>',frontmatter:{title:"Course Setup Using Google Docs and the Canvas API",date:"June 17, 2015",imageUrl:null,structuredHtml:null,image:null}}},pathContext:{path:"/course-setup-using-google-docs-and-the-canvas-api"}}}});
